description.text:
This mount replaces the foot of the &quot;Infill 3D Bowden 75 Geared Extruder&quot;. I added the openScad file, so you can make your own version that fits to your printer. I got quite close to the original size of the foot, but it is still a bit wider than the original. Worked fine for me, but again, you change that in the file as well if you don't like it.  
additional Material: 3x M5x5mm, 2x M3x8mm or 2x M3x10mm  
For those who have troubles viewing the openScad file properly: It renders correctly only with &quot;F6 - Compile&amp;Render&quot;
